{"query":"mutation ($old_weight_name: Float, $aa: Boolean!) {
  patch_pets(
    id: "2"
    data: {
      old_weight_name: $old_weight_name
      status: "WARNED"
  		best_friend: {weight: {__power: 1}}
      friends: {weight: {_mul: 1.5}}
      owners: {name: "newOwner"}
    }
    params: { my_param: 5 }
  ) {
    id
    aliasName: name
    weight
    old_weight_name
    creator_key
    created_time
    updated_time
    created_by
		updated_by
    status @skip(if: $aa)
    ...bestFriendFrag @include(if: true)
    ... on Pets @include(if: true) {
      id
    }
    owners {
      id
      name
    }
  }
}

fragment bestFriendFrag on Pets {
	best_friend {
    id
    name
  	weight @skip(if: $aa)
	}
}","variables":{"old_weight_name":3.75,"aa":true}}

